According to MITRE , Token Stealing is defined as follows: Adversaries may modify access tokens to operate under a different user or system security context to perform actions and bypass access controls. Windows uses access tokens to determine the ownership of a running process. A user can manipulate access tokens to make a running process appear as though it is the child of a different process or belongs to someone other than the user that started the process. When this occurs, the process also takes on the security context associated with the new token. With this knowledge, Mantvydas Baranauskas provides a high-level overview of how Token Stealing is generally carried out: Open a process with access token you want to steal Get a handle to the access token of that process Make a duplicate of the access token present in that process Create a new process with the newly acquired access token Now that we know the general process attackers use in Token Stealing, we can adapt that methodology to how the steal_token function works. To start things off, let's first examine the steal_token function declaration: NTSTATUS steal_token(_In_ PEPROCESS own_eproc) We see that the steal_token function takes a single read-only EPROCESS pointer called own_eproc and returns an NTSTATUS value. We know that own_eproc is a pointer to an EPROCESS structure since the standard naming convention for pointer variables usually entails the following components: A P preceding a structure name. The type being in all capital letters. Moving on, we will now examine the first variable definition: NTSTATUS status = STATUS_UNSUCCESSFUL; The first variable, status is of type NTSTATUS and is initially set to the STATUS_UNSUCCESSFUL value 0xC0000001. However, if the steal_token function locates the SYSTEM process (0x4), the status value will be set to STATUS_SUCCESS. The following variable defined, next is shown below: PLIST_ENTRY next = (PLIST_ENTRY)read64(&(own_eproc->ActiveProcessLinks)); The next var