); Thus, the cur variable is a pointer to an EPROCESS structure that contains the next address pointing to the ActiveProcessLinks field. Within the CVE-2021-31956.h header file, we see that both EPROCESS and ActiveProcessLinks are defined as part of an abridged version of _EPROCESS: typedef struct
{ char padding1[0x440]; UINT64 UniqueProcessId; LIST_ENTRY ActiveProcessLinks; char padding2[0x60]; EX_FAST_REF Token; char padding3[0x3a8]; PWNF_PROCESS_CONTEXT WnfContext;
} EPROCESS, *PEPROCESS; Here, we see that the typedef is not overwriting the _EPROCESS function prototype. Rather, it is simply creating a skeleton to be assigned as EPROCESS and by PEPROCESS. Now that we have defined all variable assignments within the steal_token function, we will now proceed onto the main for loop: for (; cur != own_eproc; next = (PLIST_ENTRY)read64(next), cur = CONTAINING_RECORD(next, EPROCESS, ActiveProcessLinks)) if ((UINT64)read64(&(cur->UniqueProcessId)) == (UINT64)0x4) { write64(&(own_eproc->Token), read64(&(cur->Token))); status = STATUS_SUCCESS; puts("[+] Stole system token!"); goto out; } Since the ActiveProcessLinks structure is a circular doubly-linked list, the for loop will terminate if the current EPROCESS is equal to our own EPROCESS. So long as this is not the case, the next variable is set to point to the cur EPROCESS' ActiveProcessLinks address. Then, the cur EPROCESS is updated to the EPROCESS pointed to by the next variable. This in-turn allows the for loop to execute the if condition on every EPROCESS in memory. The UniqueProcessId for the SYSTEM EPROCESS is equal to 0x4. Therefore, the if condition checks if the cur EPROCESS has a UniqueProcessId of 0x4. If so, the Token member of the own_eproc EPROCESS, which is our own EPROCESS, will be overwritten with the Token member of the cur EPROCESS. The status value will then set to STATUS_SUCCESS and the for loop will break via the goto out statement. If there is no EPROCESS that has a UniqueProcessId of 0x4, a log_warn message will be issued and the STATUS_UNSUCCESSFUL status will be returned. However, if the goto out statement is executed, the program will skip the log_warn line and proceed to the out: section of code and return the STATUS_SUCCESS value: log_warn("Unable to find system process token"); out: return status;

