Before discussing the specifics of the overflow_chunk function, let's first review how exactly the vulnerability can be reached from user-mode. According to the previously-covered advisory, this can be achieved through a ntoskrnl.exe system call (syscall). Therefore, we want to find any syscalls related to extended attributes (Ea). After looking through the Windows x64 syscall table provided by hfiref0x , we find the following two entries: Because the advisory mentioned the vulnerable function is called NtfsQueryEaUserEaList, we can make an educated guess and assume that the NtQueryEaFile syscall will eventually reach NtfsQueryEaUserEaList. The same logic is applied to the NtSetEaFile syscall. Thus, we will see the overflow_chunk using the NtSetEaFile syscall to create the conditions needed so that the syscall NtQueryEaFile can trigger the vulnerability. Now that we know the syscalls needed to invoke the vulnerability, let's examine it's usage within the overflow_chunk function starting with the function definition: NTSTATUS overflow_chunk(_In_ USHORT overflow_chunk_sz, _In_ char *overflow_data, _In_ USHORT overflow_data_sz) Before discussing the function definition for overflow_chunk, let's examine the values used when overflow_chunk is called in main: //CVE-2021-31956.h
