ous properties of the first Extended Attribute defined by EANAME1 and provided in the FILE_GET_EA_INFORMATION structure. Reviewing the usage of vuln_selector, we observe that it is used extensively to access the various properties of the first Extended Attribute defined by EANAME1 and provided in the FILE_GET_EA_INFORMATION structure. Similar to vuln_selector, vuln_selector2 provides the same functionality except with the target Extended Attribute being defined by EANAME2. However, it is interesting to note that the pointer for vuln_selector2 is not allocated any memory initially. However, after being declared, the pointer vuln_selector2 is then assigned to the next Extended Attribute entry at the NextEntryOffset offset of vuln_selector. Now, let's examine the purpose of the payload pointer. We see it is of the FILE_FULL_EA_INFORMATION structure, which is the same structure as the fetched_data variable. However, in this case, it is used to create the payload which will be injected via the NtSetEaFile function call. Finally, let's examine the purpose of the overflow variable. As with both fetched_data and payload, overflow is initialized as a pointer to a FILE_FULL_EA_INFORMATION structure. However, in the case of overflow, it is not allocated memory and is simply declared. Within the context of the overflow_chunk function, overflow is used to get the next Extended Attribute entry at the NextEntryOffset offset of payload. Now that we have defined the variables used within overflow_chunk, let's look at the function's purpose starting with the API call to CreateFileA: file = CreateFileA("c:\\users\\username\\desktop\\placeholder.txt", GENERIC_READ | GENERIC_WRITE, FILE_SHARE_READ | FILE_SHARE_WRITE, NULL, CREATE_ALWAYS, FILE_ATTRIBUTE_NORMAL, NULL); Since the ExtendedAttributes are associated to a file, we first need to create a user-controlled file through the CreateFileA API. if (file == INVALID_HANDLE_VALUE) { log_warn("overflow_chunk::_CreateFileA()1"); goto out;
