FILE_FULL_EA_INFORMATION *eadata2; file = CreateFileA("c:\\users\\chenl\\desktop\\ABC.txt", GENERIC_READ | GENERIC_WRITE, FILE_SHARE_READ | FILE_SHARE_WRITE, NULL, CREATE_ALWAYS, FILE_ATTRIBUTE_NORMAL, NULL); selector->EaNameLength = (UCHAR)strlen(EANAME1);
